import React from "react";

const Sidebar = () => {
  return (
    <div className="sidebar">
      <ul>
        <li>Home</li>
        <li>Sales</li>
        <li>Customers</li>
        <li>Revenue</li>
      </ul>
    </div>
  );
};

export default Sidebar;
